import { HttpClient, HttpResponse } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SimpleCalculatorService {
  constructor(private http: HttpClient) {
  }

  add(start: number, amount: number) {
    let result;
    let url = `http://localhost:5000/api/SimpleCalculator/Add?start=${start}&amount=${amount}`;


    this.http.get<number>(url).
      subscribe(response => {
        result = response.valueOf();
      });

    console.log(url)
    console.log(result);

    return start + amount;
  }

  subtract(start: number, amount: number) {
    return start - amount;
  }
}
